class Solution(object):
    def minSum(self, nums1, nums2):
        """
        :type nums1: List[int]
        :type nums2: List[int]
        :rtype: int
        """
        sum1, sum2 = sum(nums1), sum(nums2)
        zeros1, zeros2 = nums1.count(0), nums2.count(0)

        if zeros1 == 0 and zeros2 == 0:
            return sum1 if sum1 == sum2 else -1

        if zeros1 > 0 and zeros2 > 0:
            return max(sum1, sum2) + max(zeros1, zeros2)

        if zeros1 > 0:
            needed_sum = zeros1 + sum1
            if needed_sum >= sum2:
                return needed_sum
        if zeros2 > 0:
            needed_sum = zeros2 + sum2
            if needed_sum >= sum1:
                return needed_sum

        return -1
